  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0103996 includes physical
  and underway data collected aboard the HEALY during cruise HLY11TD in the Beaufort
  Sea, Bering Sea and others from 2011-08-05 to 2011-08-15. These data include CURRENT
  SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
  instruments used to collect these data include ADCP and GPS. These data were collected
  by United States Coast Guard as part of Transit. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program. The ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
